import {BrowserRouter as Router, Route, Switch} from 'react-router-dom';

// Import your authentication-related components
import Signup from './pages/Signup';

function App() {
    return (
        <Router>
            <Switch>
                <Route path="/signup" component={Signup}/>
            </Switch>
        </Router>
    );
}

export default App;
